import { Model } from '../lib';
import {
  action,
  computed,
} from 'mobx'

export default class Client extends Model {
  constructor( attributes, store ) {

    let defaultAttributes = {
      name: '',
      DNI: '',
      primaryPhone: '',
      status: '',
      secondPhone: '',
      lastName: ''
    };

    let attrs = Object.assign( defaultAttributes, attributes );

    super(attrs, store);
  }

  @computed
  get category() {
    const status = {
      'VIP': 'VIP',
      'NORMAL': 'Normal',
      'MOROSO': 'Moroso'
    };

    return status[this.status.name];
  }
}
